import React from "react";
import ReactDOM from "react-dom";

class Header extends React.Component {
  render() {
    const { title, tileEmph } = this.props;
    return (
      <div className="title-wrapper">
        <h2>
          {" "}
          {title} <b> {titleEmph}</b>{" "}
        </h2>
      </div>
    );
  }
}
